import { Box } from "@mui/material";
import { styled } from "@mui/system";

const WidgetWrapper = styled(Box)(() => (
  {
  padding: "1.5rem 1.5rem 0.75rem 1.5rem",
  backgroundColor: "#FFFFFF",
  borderRadius: "0.75rem",
}));

export default WidgetWrapper;
